('email_activation_subject', 'email_activation', NULL, '%s - Activate account', '%s    ', '%s -  ', '%s - Aktivace tu', '%s - Aktiver konto', '%s - Aktiviere dein Benutzerkonto', '%s - Activar cuenta', '    - %s', '%s - Activation de compte', '%s -  ', '%s - Fik aktivks', '%s - Aktivasi akun', '%s - Attiva il tuo account', '%s - Activateer je account', '%s - Activateer je account', '%s - Aktiver konto', '%s - Aktywuj konto', '%s -   .', '%s - Ativao da conta', '%s - Activeaz contul', '%s - Aktivera konto', '%s - Aktivcia tu', '%s - Aktiviranje rauna', '%s - Aktivacija naloga', '%s - ', '% s - Hesab etkinletir', '%s    ', '%s - Kch hot ti khon'),
